import React from 'react'
import RenderingLists from './RenderingLists'

function Book(prop) {
  const book = props.Book
  return (
    <div>
      <h5>{book.title}</h5>
      <p>{book.author}</p>
      <p>{book.pages}</p>
    </div>
  )
}

export default Book
